INSERT INTO `posts` VALUES (1,'Micromax launches 8-inch \'Canvas Tab\' priced at Rs 16,500','Confident with the popularity of its Canvas phones, Micromax launched its first premium 8-inch tablet. The flagship tablet called Canvas Tab P650 costs Rs 16,500.\r\n\r\n','The tablet does look great with all-metallic aluminium body and has specifications similar to that of the Canvas phone. It comes with a quad core processor and 1GB of RAM.\r\n\r\n','Its a 3G tablet with a slot for one SIM card and supports voice calls.','Hyderabad','2013-09-19 13:07:17','2013-09-19 13:07:17','19micromax5.jpg','image/jpeg',32394,'2013-09-19 13:07:14');
